import React from 'react';

const AppointmentForm = (props) => {

    return (
        <div className="appointment-form">
            <br/><br/>

            <form className="new-appointment-form">
                <label>Title:
                    <input type="text" 
                    name="title"
                    // value={props.form.title}
                    // onChange={props.formHandler} 
                    /></label><br/><br/>

                <label>Date:    
                <input type="date"
                // value={props.form.date}
                // onChange={props.formHandler} 
                name="date" /></label><br/><br/>

                <label>Start Time:    
                <input type="time"
                // value={props.form.date}
                // onChange={props.formHandler} 
                name="start_time" /></label><br/><br/>

                <label>End Time:    
                <input type="time"
                // value={props.form.date}
                // onChange={props.formHandler} 
                name="end_time" /></label><br/><br/>

                <label>Presentation Made:</label>
                    <input 
                        // onChange={props.onToggleArchive}
                        type="radio" 
                        name="presentation_made?" />True
                        {/* value={props.formData['presentation_made?']} 
                        checked={!!props.formData['presentation_made?'] ? true : null} */}

                    <input 
                        // onChange={props.onToggleArchive}
                        type="radio" 
                        name="presentation_made??" />False
                        {/* value={props.formData['presentation_made?']} 
                        checked={!!props.formData['presentation_made?'] ? null : true}  */}
                <br/><br/>



            </form>
        </div>
    )

}

export default AppointmentForm;
